@nidamohsin5 Hi nida

You can book tickets onsite at the self-service kiosks or from the ticketing desk in the lobby area, but this is subject to availability. We strongly recommend booking in advance on the Museum website.

We hope to see you soon 😊.

@baboosyedkafur Hello,

Thank you for your interest in Museum of the Future.

How can we help you?

A strong partnership is the foundation that makes the future a reality. We are proud to announce our association with all our partners and look forward to achieving great, new milestones together.

